import React from "react";
import "../css/App.css";
import image from "./mountain.jpeg";

class Img extends React.Component {
  render() {
    return (
      <div>
        <div className="ui fluid image">
          <img src={image} />
          <div
            style={{
              position: "absolute",
              bottom: 0,
              width: "100%",
              height: "auto",
              color: Black
            }}
          >
            Developer
          </div>
        </div>
      </div>
    );
  }
}

export default Img;
